import React from "react";
import { Form, Card, Button, Input, Space } from "antd";
import "./index.css";

const layout = {
  labelCol: {
    span: 6,
  },
  wrapperCol: {
    span: 16,
  },
};
const tailLayout = {
  wrapperCol: {
    offset: 8,
    span: 16,
  },
};

const Login = () => {
  // 提交表单且数据验证成功后回调事件
  const onFinish = (values) => {
    console.log("Success:", values);
  };
  // 提交表单且数据验证失败后回调事件
  const onFinishFailed = (errorInfo) => {
    console.log("Failed:", errorInfo);
  };
  return (
    <Card
      title="登陆页面"
      className="login-form"
    >
      <Form
        {...layout}
        name="basic"
        initialValues={{
          remember: true,
        }}
        onFinish={onFinish}
        onFinishFailed={onFinishFailed}
      >
        <Form.Item
          label="用户名"
          name="用户名"
          rules={[
            {
              required: true,
              message: "请输入用户名",
            },
          ]}
        >
          <Input />
        </Form.Item>

        <Form.Item
          label="密码"
          name="密码"
          rules={[
            {
              required: true,
              message: "请输入密码",
            },
          ]}
        >
          <Input.Password />
        </Form.Item>

        <Form.Item {...tailLayout}>
          <Space size="middle">
            <Button type="primary" htmlType="submit">
              登陆
            </Button>
            <Button type="primary" htmlType="submit">
              注册
            </Button>
          </Space>
        </Form.Item>
      </Form>
    </Card>
  );
};
export default Login;
